SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for bridge_tx
-- ----------------------------
DROP TABLE IF EXISTS `bridge_tx`;
CREATE TABLE `bridge_tx` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `bridge_data` varchar(1000) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''跨链数据''',
  `bridge_msg` longblob COMMENT '''跨链nsg''',
  `resource_id` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''resource ID''',
  `hash` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''唯一索引''',
  `vote_status` bigint DEFAULT '0' COMMENT '''vote 0失败，1成功''',
  `execute_status` bigint DEFAULT '0' COMMENT '''execute 0失败，1成功''',
  `amount` decimal(20,0) DEFAULT NULL COMMENT '''跨链数额''',
  `fee` decimal(20,0) DEFAULT NULL COMMENT '''跨链费用，万分比''',
  `caller` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''链链发起者地址''',
  `receiver` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''目标链接受者地址''',
  `source_chain_id` bigint DEFAULT NULL COMMENT '''源链ID''',
  `source_token_address` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''源链token地址''',
  `destination_chain_id` bigint DEFAULT NULL COMMENT '''目标链ID''',
  `destination_token_address` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''目标链token地址''',
  `bridge_status` tinyint DEFAULT '1' COMMENT '''跨链状态 1 源链deposit成功 2 目标链执行成功 3 失败''',
  `deposit_hash` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''deposit tx hash''',
  `execute_hash` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''execute tx hash''',
  `deposit_at` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''跨链发起时间''',
  `receive_at` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''跨链到账时间''',
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_bridge_tx_deleted_at` (`deleted_at`)
) ENGINE=InnoDB AUTO_INCREMENT=305 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

