-- ----------------------------
-- Table structure for chain_info
-- ----------------------------
DROP TABLE IF EXISTS `chain_info`;
CREATE TABLE `chain_info` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `chain_name` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''链名称''',
  `chain_id` bigint DEFAULT NULL COMMENT '''自定义链ID''',
  `endpoint` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''RPC''',
  `from` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''签名账户地址''',
  `private_key` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''签名账户私钥''',
  `fresh_start` tinyint(1) DEFAULT NULL COMMENT '''启动时，是否从设置的起始块高开始.true 从设置的块高开始，false 从block store开始''',
  `bridge_contract` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''bridge合约地址''',
  `vote_contract` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''vote合约地址''',
  `gas_limit` bigint DEFAULT NULL COMMENT '''''',
  `max_gas_price` bigint DEFAULT NULL COMMENT '''''',
  `min_gas_price` bigint DEFAULT NULL COMMENT '''''',
  `http` bigint DEFAULT '1' COMMENT '''http or ws. 1 http 0 ws''',
  `start_block` bigint DEFAULT NULL COMMENT '''起始块高''',
  `block_confirmations` bigint DEFAULT NULL COMMENT '''待确认块高差''',
  `latest_block` tinyint(1) DEFAULT NULL COMMENT '''启动时，是否从设置的起始块高开始.true 从区块链当前的块高开始''',
  `block_store` bigint DEFAULT NULL COMMENT '''扫过的块高''',
  `chain_type` bigint DEFAULT NULL COMMENT '''自定义链类型ID,1 EVM 2 TRON''',
  `open` bigint DEFAULT NULL COMMENT '''是否开启 1 开启 0关闭''；default:1',
  `logo` longtext COLLATE utf8mb4_general_ci COMMENT '''链logo''',
  `explorer` longtext COLLATE utf8mb4_general_ci COMMENT '''浏览器地址''',
  `block_chain_id` bigint DEFAULT NULL COMMENT '''链ID''',
  `native_coin_name` longtext COLLATE utf8mb4_general_ci COMMENT '''native coin''',
  `native_coin_symbol` longtext COLLATE utf8mb4_general_ci COMMENT '''native coin''',
  `native_coin_decimals` longtext COLLATE utf8mb4_general_ci COMMENT '''native coin''',
  `tantin_contract` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '''tantin合约地址''',
  PRIMARY KEY (`id`),
  KEY `idx_config_deleted_at` (`deleted_at`),
  KEY `idx_chain_info_deleted_at` (`deleted_at`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

